import React from "react";
import QRImage from "react-qr-image";
import Modal from "../componets/Modal";

const QrGenerato = ({ salir, url }) => {
  return (
    <Modal cerrar={() => salir} titulo={"QR "}>
      <QRImage>{url}</QRImage>
    </Modal>
  );
};

export default QrGenerato;
